import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { Container, Row, Col } from 'react-bootstrap';
import DefaultWait from './DefaultWait';

function App() {
  return (
    <div className="App">
      <main>
        <Container className="container">
          <Row>
            <Col>
              <h1>Bienvenu</h1>
            </Col>
          </Row>
          <Row>
            <Col className="form-container">
              <DefaultWait />
            </Col>
          </Row>
        </Container>
      </main>
    </div>
  );
}

export default App;
